@Luciana72800716 Amém.
Meu sogro não deu conta. Terminou a vida aos 78 anos produzindo uma tragédia familiar, há 2 meses atrás. Tirou a vida da minha sogra que estava doente há 9 meses em estado semi-vegetativo, e em seguida a própria vida.

Que ninguém nunca menospreze essa doença silenciosa.
